import React from "react";
import styled from "styled-components";
import StarIcon from "@mui/icons-material/Star"; // Полная звезда
import StarBorderRoundedIcon from "@mui/icons-material/StarBorderRounded";
import StarHalfRoundedIcon from "@mui/icons-material/StarHalfRounded";
import { MoreInfo } from "../../buttons/WatchNow";
import Plus from "../../buttons/Plus";

const Wrapper = styled.div`
  margin-top: 60px;
  margin-left: 227px;
`;

const MainTitle = styled.h2`
  font-family: Lato;
  font-size: 30px;
  font-weight: 800;
  line-height: 30px;
`;

const Card = styled.div`
  width: 237px;
  height: 298px;
  margin-top: 30px;
  position: relative;
`;

const Title = styled.h3`
  font-family: Lato;
  font-size: 24px;
  font-weight: 800;
  line-height: 24px;
  position: absolute;
  top: 21px;
  left: 21px;
`;

const Episodes = styled.p`
  position: absolute;
  left: 10px;
  top: 199px;
  font-family: Lato;
  font-size: 18px;
  font-weight: 700;
  line-height: 18px;
  color: rgba(249, 249, 249, 0.7);
`;

const Genre = styled.p`
  position: absolute;
  right: 10px;
  top: 199px;
  font-family: Lato;
  font-size: 18px;
  font-weight: 700;
  line-height: 18px;
  color: rgba(249, 249, 249, 0.7);
`;

const Stars = styled.p`
  position: absolute;
  left: 21px;
  top: 57px;
`;

const Image = styled.img`
  width: 100%;
`;

const Movies = () => {
  return (
    <Wrapper>
      <MainTitle>Movies</MainTitle>
      <Card>
        <Image src="/images/LokiMovies.png" />
        <Title>Loki</Title>
        <Stars>
          <StarIcon sx={{ color: "yellow", fontSize: "15px" }} />
          <StarIcon sx={{ color: "yellow", fontSize: "15px" }} />
          <StarIcon sx={{ color: "yellow", fontSize: "15px" }} />
          <StarIcon sx={{ color: "yellow", fontSize: "15px" }} />
          <StarHalfRoundedIcon sx={{ color: "yellow", fontSize: "15px" }} />
        </Stars>

        <Episodes>6 Ep</Episodes>
        <Genre>Superhero</Genre>

        <MoreInfo>More Info</MoreInfo>
        <Plus />
      </Card>
    </Wrapper>
  );
};

export default Movies;
